新型マークX専用のLEDヘッドライトです。製品は純正HID車対応のライトキットになります。（ハロゲンバルブ車輌には装着できませんのでご注意ください）交換は純正ライトを外し、純正で装着されているライトバルブ、純正バラストを移植していただきます。（専門店での取付をおすすめ致します）<br><br>●カラー：クロームメッキ ●左右セット ●純正HID・バルブ対応<br><br>※ハイビーム側のバルブはH1型ハロゲンが内臓されており純正のカプラーを使用し点灯致しますので純正のHB3型バルブは使用できませんのでご注意下さい。<br><br>対応車種：GRX13# マークX<br><br>保安基準適合品<br><br>ランプ、レンズ | ヘッドランプ<tr><td colspan="2">
