現行型AUDIに代表される近未来的な表情のLEDポジショニングランプを備えたデビルアイヘッドライトが新登場！事故の破損時や、経年劣化での黄ばみや汚れなどでお悩みの方にお勧めです。純正新品は非常に高価ですが、この製品だと安価に交換が可能です。新車のようなすっきりした見た目になります。<br><br>●純正HIDヘッドライト車用（HIDユニット/バルブ/レベライザーモーターは純正ヘッドライトから流用します。当製品には含まれません） ●バルブ：ロー側 HID D4R（純正流用）/ハイ側 H1（55W） ●左右セット ●6LEDポジションランプ＋LEDリング装備 ●マニュアルレベリング対応 ●光軸調整機能 ●左側通行用（日本国内仕様） ●バラスト取付用ホルダー ●バラスト/レベライザー取扱説明書※写真クロームになります。実際の製品とは仕様が異なる場合がございます。<br><br>【LEDの球切れ、水漏れ（レンズ接合部からの水滴の浸入）に対してご購入されてから1年間完全保証いたします。※保証が適用されるのは製品本体に保証番号の付いたSONAR正規品のみとなりますのでご了承下さい。】<br><br><br>対応車種：10/7～ 200系 ハイエース/レジアスエース 後期 レベリング付 HID車<br><br>ランプ、レンズ | ヘッドランプ<br>トヨタ | ハイエース/レジアスエース | H200系 <br>※メーカー在庫切れの場合は納期を別途ご案内いたします。<tr><td colspan="2">
